databaseChangeLog: 
  - changeSet:
      id: FIBI-7451
      author: Prabhu.E
      labels: 'DML'
      comment: Add Lookup Window for State in FIBI 
      changes:
        - sql:
            sql: |
              INSERT INTO PARAMETER (PARAMETER_NAME, VALUE, DESCRIPTION, UPDATE_TIMESTAMP, UPDATE_USER)
              SELECT 'SR_GLOBAL_SEARCH_ENABLED_MODULES', '', 'The comma separated list of module codes in which service request global search should display', NOW(), 'admin'
              WHERE NOT EXISTS (
                SELECT 1 FROM PARAMETER
                WHERE PARAMETER_NAME = 'SR_GLOBAL_SEARCH_ENABLED_MODULES'
              );
      rollback:
        - sql:
            sql: |
              DELETE FROM PARAMETER WHERE PARAMETER_NAME = 'SR_GLOBAL_SEARCH_ENABLED_MODULES';

  - changeSet:
      id: FIBI-7575-1
      author: Manesh.MS
      labels: 'DML'
      comment: Update CORRESPONDENCE_TEMPLATE for LETTER_TEMPLATE_TYPE_CODE 3002 (Service Request Summary Template)
      changes:
        - sql:
            sql: |
              SET SQL_SAFE_UPDATES = 0;
              UPDATE LETTER_TEMPLATE_TYPE SET CORRESPONDENCE_TEMPLATE = UNHEX('') WHERE LETTER_TEMPLATE_TYPE_CODE = 3002;
              SET SQL_SAFE_UPDATES = 1;

      rollback: empty
